import React from "react";

function Footer() {
  return (
    <div>
      <footer class="footer">
        <p class="footerClass">
          Copyright 2022 Jacob Stout
          <a href="https://github.com/JediJake66">Github Portfolio</a>
        </p>
      </footer>
    </div>
  );
}

export default Footer;
